(284, 193, '_elementor_data', '[{\"id\":\"79e68c4\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"c983001\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"04b8036\",\"elType\":\"widget\",\"settings\":{\"space\":{\"unit\":\"px\",\"size\":10,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"spacer\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"0d92e19\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\",\"hide_tablet\":\"hidden-tablet\"},\"elements\":[{\"id\":\"ad03551\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":67.437},\"elements\":[{\"id\":\"1371105\",\"elType\":\"widget\",\"settings\":{\"title\":\"Welcome To Yellow Captain\",\"title_color\":\"#FFC931\",\"align_mobile\":\"center\",\"typography_typography\":\"custom\",\"typography_font_size_mobile\":{\"unit\":\"px\",\"size\":19,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"1d8ea19\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p><strong>Yellow Captain<\\/strong>, the Pizza Specialist, tastefully decorated, softly lit place at Vision City Mall serves a good mix of dishes including pizza, pasta, salad and dessert. Although well embedded in modern culture, Pizzas are now one the world\\u2019s best selling fast foods.\\u00a0 Our philosophy behind making a great pizza is simple \\u2013\\u00a0<strong>less is more!<\\/strong>\\u00a0 To have wonderful toppings on the pizza that shine and stand out, with not too many competing flavors and drown in too much cheese. Apart from great food, there\\u2019s a friendly atmosphere, good service and the prices are very reasonable. You are likely to be dinning with a who\\u2019s who of PNG\\u2019s movers and shakers<\\/p>\",\"align\":\"justify\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false},{\"id\":\"623b1b8\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":32.563},\"elements\":[{\"id\":\"6457b95\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost\\/store\\/wp-content\\/uploads\\/2020\\/04\\/Capture-3-300x235-1.jpg\",\"id\":1177},\"align\":\"right\",\"hide_mobile\":\"hidden-phone\"},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"860ad66\",\"elType\":\"section\",\"settings\":{\"hide_desktop\":\"hidden-desktop\",\"hide_mobile\":\"hidden-phone\"},\"elements\":[{\"id\":\"3ac40ba\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"00a85d7\",\"elType\":\"widget\",\"settings\":{\"title\":\"Welcome To Yellow Captain\",\"title_color\":\"#FFC931\"},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"7b6f868\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p><strong>Yellow Captain<\\/strong>, the Pizza Specialist, tastefully decorated, softly lit place at Vision City Mall serves a good mix of dishes including pizza, pasta, salad and dessert. Although well embedded in modern culture, Pizzas are now one the world\\u2019s best selling fast foods.\\u00a0 Our philosophy behind making a great pizza is simple \\u2013\\u00a0<strong>less is more!<\\/strong>\\u00a0 To have wonderful toppings on the pizza that shine and stand out, with not too many competing flavors and drown in too much cheese. Apart from great food, there\\u2019s a friendly atmosphere, good service and the prices are very reasonable. You are likely to be dinning with a who\\u2019s who of PNG\\u2019s movers and shakers<\\/p>\",\"align\":\"justify\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),
