(6, 1, '2020-04-19 04:03:36', '2020-04-19 04:03:36', '{\"id\":6,\"field_id\":4,\"fields\":{\"0\":{\"id\":\"0\",\"type\":\"name\",\"label\":\"Name\",\"format\":\"simple\",\"description\":\"\",\"required\":\"1\",\"size\":\"large\",\"simple_placeholder\":\"Name\",\"simple_default\":\"\",\"first_placeholder\":\"\",\"first_default\":\"\",\"middle_placeholder\":\"\",\"middle_default\":\"\",\"last_placeholder\":\"\",\"last_default\":\"\",\"label_hide\":\"1\",\"css\":\"\"},\"1\":{\"id\":\"1\",\"type\":\"email\",\"label\":\"Email\",\"description\":\"\",\"required\":\"1\",\"size\":\"large\",\"placeholder\":\"Email\",\"confirmation_placeholder\":\"\",\"label_hide\":\"1\",\"default_value\":\"\",\"css\":\"\"},\"3\":{\"id\":\"3\",\"type\":\"number\",\"label\":\"Contact Number\",\"description\":\"\",\"required\":\"1\",\"size\":\"large\",\"placeholder\":\"Contact Number\",\"label_hide\":\"1\",\"default_value\":\"\",\"css\":\"\"},\"2\":{\"id\":\"2\",\"type\":\"textarea\",\"label\":\"Your Message\",\"description\":\"\",\"required\":\"1\",\"size\":\"medium\",\"placeholder\":\"Your Message\",\"label_hide\":\"1\",\"limit_count\":\"1\",\"limit_mode\":\"characters\",\"default_value\":\"\",\"css\":\"\"}},\"settings\":{\"form_title\":\"Contact Form\",\"form_desc\":\"\",\"form_class\":\"\",\"submit_text\":\"Send Request\",\"submit_text_processing\":\"Sending...\",\"submit_class\":\"\",\"honeypot\":\"1\",\"notification_enable\":\"1\",\"notifications\":{\"1\":{\"email\":\"email@example.com\",\"subject\":\"New Entry: Simple Contact Form\",\"sender_name\":\"{field_id=\\\"0\\\"}\",\"sender_address\":\"email@example.com\",\"replyto\":\"{field_id=\\\"1\\\"}\",\"message\":\"{all_fields}\"}},\"confirmations\":{\"1\":{\"type\":\"message\",\"message\":\"<p>Thanks for contacting us! We will be in touch with you shortly.<\\/p>\",\"message_scroll\":\"1\",\"page\":\"193\",\"redirect\":\"\"}}},\"meta\":{\"template\":\"contact\"}}', 'Contact Form', '', 'publish', 'closed', 'closed', '', 'contact-form', '', '', '2020-04-19 04:03:36', '2020-04-19 04:03:36', '', 0, 'http://localhost/store/?post_type=wpforms&#038;p=6', 0, 'wpforms', '', 0),
