(193, 1, '2017-08-16 08:50:13', '2017-08-16 08:50:13', '<h2>Welcome To Yellow Captain</h2>		\n		<p><strong>Yellow Captain</strong>, the Pizza Specialist, tastefully decorated, softly lit place at Vision City Mall serves a good mix of dishes including pizza, pasta, salad and dessert. Although well embedded in modern culture, Pizzas are now one the world’s best selling fast foods.  Our philosophy behind making a great pizza is simple – <strong>less is more!</strong>  To have wonderful toppings on the pizza that shine and stand out, with not too many competing flavors and drown in too much cheese. Apart from great food, there’s a friendly atmosphere, good service and the prices are very reasonable. You are likely to be dinning with a who’s who of PNG’s movers and shakers</p>		\n										<img width=\"300\" height=\"235\" src=\"http://localhost/store/wp-content/uploads/2020/04/Capture-3-300x235-1.jpg\" alt=\"\" />											\n			<h2>Welcome To Yellow Captain</h2>		\n		<p><strong>Yellow Captain</strong>, the Pizza Specialist, tastefully decorated, softly lit place at Vision City Mall serves a good mix of dishes including pizza, pasta, salad and dessert. Although well embedded in modern culture, Pizzas are now one the world’s best selling fast foods.  Our philosophy behind making a great pizza is simple – <strong>less is more!</strong>  To have wonderful toppings on the pizza that shine and stand out, with not too many competing flavors and drown in too much cheese. Apart from great food, there’s a friendly atmosphere, good service and the prices are very reasonable. You are likely to be dinning with a who’s who of PNG’s movers and shakers</p>', 'About', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2020-04-19 08:48:10', '2020-04-19 08:48:10', '', 0, 'http://localhost/store/about/', 0, 'page', '', 0),
