(1207, 1, '2020-04-19 05:17:28', '2020-04-19 05:17:28', '<h2>Welcome To Yellow Captain</h2>		\n		<p><strong>Yellow Captain</strong>, the Pizza Specialist, tastefully decorated, softly lit place at Vision City Mall serves a good mix of dishes including pizza, pasta, salad and dessert. Although well embedded in modern culture, Pizzas are now one the world’s best selling fast foods.  Our philosophy behind making a great pizza is simple – <strong>less is more!</strong>  To have wonderful toppings on the pizza that shine and stand out, with not too many competing flavors and drown in too much cheese. Apart from great food, there’s a friendly atmosphere, good service and the prices are very reasonable. You are likely to be dinning with a who’s who of PNG’s movers and shakers.</p>		\n										<img width=\"300\" height=\"274\" src=\"http://localhost/store/wp-content/uploads/2020/04/Logo-300x274.jpg\" alt=\"\" srcset=\"http://localhost/store/wp-content/uploads/2020/04/Logo-300x274.jpg 300w, http://localhost/store/wp-content/uploads/2020/04/Logo.jpg 561w\" sizes=\"(max-width: 300px) 100vw, 300px\" />', 'Home', '', 'inherit', 'closed', 'closed', '', '355-revision-v1', '', '', '2020-04-19 05:17:28', '2020-04-19 05:17:28', '', 355, 'http://localhost/store/2020/04/19/355-revision-v1/', 0, 'revision', '', 0),
