(1256, 1, '2020-04-19 08:27:57', '2020-04-19 08:27:57', '<h2>Welcome To Yellow Captain</h2>\n<strong>Yellow Captain</strong>, the Pizza Specialist, tastefully decorated, softly lit place at Vision City Mall serves a good mix of dishes including pizza, pasta, salad and dessert. Although well embedded in modern culture, Pizzas are now one the world’s best selling fast foods.&nbsp; Our philosophy behind making a great pizza is simple –&nbsp;<strong>less is more!</strong>&nbsp; To have wonderful toppings on the pizza that shine and stand out, with not too many competing flavors and drown in too much cheese. Apart from great food, there’s a friendly atmosphere, good service and the prices are very reasonable. You are likely to be dinning with a who’s who of PNG’s movers and shakers.', 'Home', '', 'inherit', 'closed', 'closed', '', '1211-revision-v1', '', '', '2020-04-19 08:27:57', '2020-04-19 08:27:57', '', 1211, 'http://localhost/store/2020/04/19/1211-revision-v1/', 0, 'revision', '', 0),
