(1275, 1, '2020-04-20 01:04:39', '2020-04-20 01:04:39', '<img class=\"alignnone size-full wp-image-1244\" src=\"http://localhost/store/wp-content/uploads/2020/04/images-1.jpeg\" alt=\"\" width=\"284\" height=\"177\" />', 'Chicken Pizza', '<b>Pizza</b> (Italian: [ˈpittsa], Neapolitan: [ˈpittsə]) is a savory dish of Italian origin, consisting of a usually round, flattened base of leavened wheat-based dough topped with tomatoes, cheese, and often various other ingredients (anchovies, olives, meat, etc.) ... A small <b>pizza</b> is sometimes called a pizzetta.', 'publish', 'open', 'closed', '', 'chicken-pizza', '', '', '2020-04-20 01:08:48', '2020-04-20 01:08:48', '', 0, 'http://localhost/store/?post_type=product&#038;p=1275', 10, 'product', '', 0),
